	add("microcosm", "{\"term\":\"microcosm\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From French \u0027microcosme\u0027 from Latin \u0027microcosmus\u0027 from Ancient greek (to 1453) \u0027μικρός\u0027 (small) + \u0027κόσμος\u0027 (world)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Human nature or the human body as representative of the wider universe; man considered as a miniature counterpart of divine or universal nature\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1972\u0027\u0027, Rolf Soellner, \u0027Shakespeare\u0027s Patterns of Self-Knowledge\u0027, Chapter 3: \u0027\u0027\u0027Microcosm\u0027\u0027 and Macrocosm: Framing The Picture of Man\u0027, [http://books.google.com/books?id\u003dbOIb_gjFuSsC\u0026amp;pg\u003dPA43\u0026amp;dq\u003d%22microcosm%7Cmicrocosms%22\u0026amp;hl\u003den\u0026amp;ei\u003d_DuITvuiGaPFmAW01OEn\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d10\u0026amp;ved\u003d0CFIQ6AEwCTg\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22microcosm%7Cmicrocosms%22\u0026amp;f\u003dfalse page 43\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The Christian humanists were emphatic in their demand that a man who wishes to understand himself must realize that he is a little world that reflects on a smaller scale the larger world of the universe.On the other hand, the whole idea of man as a \u0027\u0027microcosm\u0027\u0027 was questioned by those who were not in sympathy with the Christian humanists\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The human body; a person\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"s:The Tragedy of The Tragedy of Coriolanus\u0027, First Folio 1623, Act 2, Scene 1\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"If you see this in the Map of my \u0027\u0027Microcosme\u0027\u0027, followes it that I am knowne well enough too\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A smaller system which is seen as representative a larger one\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Barry McIntyre, \u0027The Guardian\u0027, 16 Dec 1999\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"‘In a sense, the problems experienced at Bristol are like a \u0027\u0027microcosm\u0027\u0027 of what is happening in the NHS - experienced surgeons battling against difficult circumstances, with inadequate resources and in a culture where the finding of scapegoats appears to be put before the finding of solutions\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A small natural ecosystem; an artificial ecosystem set up as an experimental model\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Jerry C. Smrchek, Maurice G. Zeeman, Chapter 3: \u0027Assessing Risks to Ecological Systems from Chemicals\u0027, Peter P. Calow (editor), \u0027Handbook of Environmental Risk Assessment and Management\u0027, [http://books.google.com/books?id\u003dGg9eD5qz2jAC\u0026amp;pg\u003dPA53\u0026amp;dq\u003d%22microcosm%7Cmicrocosms%22\u0026amp;hl\u003den\u0026amp;ei\u003d_DuITvuiGaPFmAW01OEn\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d5\u0026amp;ved\u003d0CDoQ6AEwBDg\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22microcosm%7Cmicrocosms%22\u0026amp;f\u003dfalse page 53\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The method is relatively labour intensive (24-30 \u0027\u0027microcosms\u0027\u0027 are run) and more difficult to interpret when compared with other \u0027\u0027microcosm\u0027\u0027 methods (Shannon et al. 1986; Cairns \u0026amp; Cherry 1993\", \"priority\":14}]}, \"synonyms\":{}}");

	add("microcosmos", "{\"term\":\"microcosmos\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|cosmos|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small or microscopic cosmos; a microcosm\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1916\u0027\u0027, \u0027Classical Philology\u0027 (University of Chicago Press), volume 11, [http://books.google.co.uk/books?id\u003dbe04AAAAMAAJ\u0026amp;q\u003d%22microcosmoi%22\u0026amp;dq\u003d%22microcosmoi%22\u0026amp;hl\u003den\u0026amp;ei\u003drs8YTKObN5X-4Abv8ujjCw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d1\u0026amp;ved\u003d0CCoQ6AEwADgK page 222\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"So the double men of Aristophanes are \u0027\u0027microcosmoi\u0027\u0027 (p. 566); as the world is divided, so are they\", \"priority\":3}]}, \"synonyms\":{}}");

