	add("microdonation", "{\"term\":\"microdonation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|donation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A donation of a very small amount\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, John Grant, \u0027Co-Opportunity: Join Up for a Sustainable, Resilient, Prosperous World\u0027 (page 170\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Other projects include 1BOG (One Block Off The Grid) and Greenfund – a venture fund for green businesses from \u0027\u0027microdonations\u0027\u0027: if 200 million people on Facebook each put in $1000, the fund could compete with the World Bank\", \"priority\":3}]}, \"synonyms\":{}}");

