	add("microfoam", "{\"term\":\"microfoam\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|micro|foam|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Foam consisting of very small bubbles, specifically as an element in the steamed milk used to make certain types of latte coffee\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Roseane Santos, \u0027An Unashamed Defence of Coffee\u0027, p. 188\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"When a barista steams the milk for a \u0027cappuccino\u0027, \u0027\u0027microfoam\u0027\u0027 is created by introducing very tiny bubbles of air into the milk, giving the milk a velvety texture and sweetness\", \"priority\":3}]}, \"synonyms\":{}}");

	add("microgamete", "{\"term\":\"microgamete\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|gamete|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The smaller of a pair of conjugating gametes; often the male\", \"priority\":1}]}, \"synonyms\":{}}");

	add("microgenesis", "{\"term\":\"microgenesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|genesis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of a body part which has developed abnormally small\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The development, in discrete but generally imperceptible (seemingly continuous) increments, by the human body or brain, of thoughts, motions, or actions\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1975\u0027\u0027, \u0027American Handbook of Psychiatry: Organic Disorder and Psychosomatic Medicine\u0027, page 272\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The term \u0027\u0027microgenesis\u0027\u0027 has been proposed for the continuous formative activity which underlies cognition\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, G. Jason, Geoffrey Hammond, \u0027Cerebral Control of Speech and Limb Movements\u0027, page 154\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Goldberg (1985) has proposed that the SMA is part of a medial system which is crucial in the programming and fluent execution of movements on the basis of internal models of reality. He hypothesized that there are two stages in the \u0027\u0027microgenesis\u0027\u0027 of movement, each stage being a loop consisting of a number of cortical and subcortical structures. The first stage involves the selection of a context-appropriate behavioral strategy, and the second involves the specification of the details required to execute the action\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, \u0027w:Cornell Cornell Working Papers in Linguistics: Volumes 13-15\u0027, page 104\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"the gesture is highly conventionalized, a formal linguistic sign in and of itself requiring no verbal representation to be understood (for example, when a young child is told to \u0027wave bye bye\u0027). McNeill (1992) believes that there are different qualities that accompany this continuum in relation to the \u0027\u0027microgenesis\u0027\u0027 of an utterance, stating that at the beginning there is a \u0027spontaneous\u0027 use of gestures which is connected with the germination of a thought, while the use of conventionalized gestures corresponds to the final stages of the thought process\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Talis Bachmann, \u0027Microgenetic Approach to the Conscious Mind\u0027, page 200\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Like in action where one should execute the movements or responses one at a time (and it is physically impossible to do it otherwise, circus practices notwithstanding), \u0027\u0027microgenesis\u0027\u0027 tends to solve one or another subtask at different stages of its unfolding. In high-level activity, particular efferent operations often unfold as more or less arbitrary segments in a continuous flow of actions. [...] Can you tell the exact moment when a ball-toss ends and the strike for the serve begins in tennis? Not so easily. Similarly, in \u0027\u0027microgensis\u0027\u0027, stages unfold as somewhat arbitrarily isolable epochs in a continuous flow of percept genesis\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Mark Germine, \u0027The microgenesis of antisociality: a process-relational perspective\u0027, which is chapter 6 of \u0027Neuropsychology and Philosophy of Mind in Process: Essays in Honor of Jason Brown\u0027, beginning on page 144 of that book\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The intention of this paper is to open up a dialogue on the wider implications of \u0027\u0027microgenesis\u0027\u0027, particularly as it applies to the process-relational view of intersubjectivity\", \"priority\":12}]}, \"synonyms\":{}}");

