	add("microkinesis", "{\"term\":\"microkinesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|micro|kinesis|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The ability to move objects on a microscopic level with the power of one\u0027s mind\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Alexandra Hughes, \u0027Marked\u0027, Penguin Group, [http://books.google.com/books?id\u003dMcrwAAAAQBAJ\u0026amp;pg\u003dPT55\u0026amp;dq\u003d%22microkinesis%2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage page 55\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"to arrange for him to be treated by a Guild medic who could repair the heart with \u0027\u0027microkinesis\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Random and meaningless movements made by a new-born infant\", \"priority\":5}]}, \"synonyms\":{}}");

