	add("microliterature", "{\"term\":\"microliterature\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A body of short articles and publications, each containing only a little new information\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1961\u0027\u0027, Allen Kent (ed.), \u0027Information Retrieval and Machine Translation, page 104\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"By a systematic scanning of \u0027\u0027microliterature\u0027\u0027, a list of these can be made\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"There is now such an immense \u0026quot;\u0027\u0027microliterature\u0027\u0027\u0026quot; on hepatics that, beyond a certain point I have given up trying to integrate (and evaluate) every minor paper published—especially narrowly floristic papers\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Laurence J. Kotlikoff, \u0026quot;Intergenerational Altruism\u0026quot;, \u0027Essays on Saving, Bequests, Altruism, and Life-cycle Planning‎\u0027, page 18\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Finally, there is a \u0027\u0027microliterature\u0027\u0027 on transfers (see Cox 1987 and Kotlikoff 1988 for summaries) that appears, on balance, to reject the altruism model\", \"priority\":6}]}, \"synonyms\":{}}");

	add("microlith", "{\"term\":\"microlith\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|micro|lith|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small stone tool\", \"priority\":1}]}, \"synonyms\":{}}");

