	add("micronisation", "{\"term\":\"micronisation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process by which a material is reduced in size, often to micrometer proportions\", \"priority\":1}]}, \"synonyms\":{}}");

	add("micronuke", "{\"term\":\"micronuke\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|nuke|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hypothetical nuclear weapon built on a very small scale\", \"priority\":1}]}, \"synonyms\":{}}");

	add("microorganism", "{\"term\":\"microorganism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|micro|organism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An organism that is too small to be seen by the unaided eye, \u0027especially\u0027 a single-celled organism, such as a bacterium\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The cud is then reswallowed and further digested by specialized \u0027\u0027microorganisms\u0027\u0027 that live in the rumen\", \"priority\":2}]}, \"synonyms\":{}}");

