	add("microphotograph", "{\"term\":\"microphotograph\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|photograph|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A photograph so reduced in size that it must be viewed through a lens or a microscope\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1962\u0027\u0027, UNESCO, \u0027UNESCO Bulletin for Libraries\u0027, Volume 16\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The advantages of the use of photographic reduction in recording documents are so obvious that it is not surprising that the first \u0027\u0027microphotograph\u0027\u0027 was made shortly after the invention of photography [1-4].\u0026lt;sup\u0026gt;1\u0026lt;/sup\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Michael R. Peres, \u0027Focal Encyclopedia of Photography: Digital Imaging, Theory and Applications\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Microphotograph\u0027\u0027 slides, however, required an expensive microscope for viewing, which make them beyond the reach of the average person\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, John Hannavy (editor), \u0027Encyclopedia of Nineteenth-Century Photography\u0027, Volume 1\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Dancer\u0027s first \u0027\u0027microphotograph\u0027\u0027, a daguerrotype of a 20 inches long document reduced to 3mm in length, was printed in 1839\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A photograph taken through a microscope, an enlarged picture of a very small item or area; a photomicrograph\", \"priority\":8}]}, \"synonyms\":{}}");

