	add("micropolygyria", "{\"term\":\"micropolygyria\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A neuronal migration disorder, a developmental anomaly of the brain characterized by development of numerous small convolutions (microgyri), causing mental retardation\", \"priority\":1}]}, \"synonyms\":{}}");

