	add("microprocessor", "{\"term\":\"microprocessor\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|processor|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the entire CPU of a computer on a single integrated circuit (chip\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Michael A. Miller, \u0027The 68000 Microprocessor Family: Architecture, Programming, and Applications\u0027 (page 47\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"When the \u0027\u0027microprocessor\u0027\u0027 decodes the JSR opcode, it stores the operand into the TEMP register and pushes the current contents of the PC ($00 0128) onto the stack\", \"priority\":3}]}, \"synonyms\":{}}");

