	add("micropyle", "{\"term\":\"micropyle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French from Ancient greek (to 1453) \u0027lang\u003dgrc|μικρός\u0027 () + \u0027lang\u003dgrc|πύλη\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In seed-bearing plants, a small opening in the integuments of the ovule through which sperm are able to access the ovum\", \"priority\":1}]}, \"synonyms\":{}}");

