	add("microreplication", "{\"term\":\"microreplication\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|replication|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"replication of microscale structures\", \"priority\":1}]}, \"synonyms\":{}}");

