	add("microrna", "{\"term\":\"microrna\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|RNA|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A single-stranded, non-coding form of RNA, having only about 20-30 nucleotides, that has a number of functions including the regulation of gene expression\", \"priority\":1}]}, \"synonyms\":{}}");

	add("microroughness", "{\"term\":\"microroughness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|roughness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being rough at microscale\", \"priority\":1}]}, \"synonyms\":{}}");

