	add("microscale", "{\"term\":\"microscale\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|scale|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very small or microscopic scal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The scale of microanalysi\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A scale of physical consideration or of bounds having a characteristic dimension typically ranging from 1 to 999 µm (under 1 mm\", \"priority\":3}]}, \"synonyms\":{}}");

