	add("microscopy", "{\"term\":\"microscopy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the study of microscopes, their design and manufactur\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the use of microscopes\", \"priority\":2}]}, \"synonyms\":{}}");

	add("microsecond", "{\"term\":\"microsecond\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|second|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"It is commonly represented with symbol µs\", \"priority\":1}]}, \"synonyms\":{}}");

