	add("microsegment", "{\"term\":\"microsegment\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|segment|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very precise division of a market\", \"priority\":1}]}, \"synonyms\":{}}");

	add("microseism", "{\"term\":\"microseism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|seism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A faint earth tremor caused by natural phenomena, such as wind\", \"priority\":1}]}, \"synonyms\":{}}");

	add("microsensor", "{\"term\":\"microsensor\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|sensor|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several very small sensors that detect small amounts, or changes in a physical variable\", \"priority\":1}]}, \"synonyms\":{}}");

	add("microserf", "{\"term\":\"microserf\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|why not micro(computer) and serf? or is it from Coupland\u0027s book \u0027Microserfs\u0027?|lang\u003den}}{{blend|Microsoft|serf|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An individual working in a low-paid service industry position using information technologies, usually with only basic qualification, unable to move to a higher paid position\", \"priority\":1}]}, \"synonyms\":{}}");

	add("microsite", "{\"term\":\"microsite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|site|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A self-contained page or group of pages meant to supplement a larger websit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The movie site has a \u0027\u0027microsite\u0027\u0027 where fans can speculate about the ending\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A small area with distinctive ecological characteristic\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"This species was found only in the \u0027\u0027microsite\u0027\u0027 at the foot of the bluff\", \"priority\":4}]}, \"synonyms\":{}}");

	add("microsleep", "{\"term\":\"microsleep\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|sleep|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A brief period of sleep, usually of a few seconds, that may result from sleep deprivation or various medical conditions\", \"priority\":1}]}, \"synonyms\":{}}");

	add("microsoft", "{\"term\":\"microsoft\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027w:Microsoft|Microsoft\u0027, the computing company; a {{blend|microcomputer|software|nocap\u003d1|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a company whose products are widespread\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Daniel Charles, \u0027Lords of the Harvest: Biotech, Big Money, and the Future of Food\u0027 (ISBN 0738202916), page 110\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Similarly, said Fraley, farmers were going to demand Bt cotton or Roundup-resistant soybean plants no matter where they went shopping for seeds. Monsanto would be the \u0027\u0027Microsoft\u0027\u0027 of agriculture\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Merrill Goozner, \u0027The $800 Million Pill: The Truth Behind the Cost of New Drugs\u0027 (ISBN 0520246705), page 64\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The company wanted to turn Celera into the \u0027\u0027Microsoft\u0027\u0027 of the gene-hunting world, selling its version of the human genome to private or public gene hunters through a proprietary computer program\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Andrew Beaujon, \u0027Body Piercing Saved My Life: Inside the Phenomenon of Christian Rock\u0027 (ISBN 0306814579), page 232\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Shepherding is more or less gone (though there’s an interesting move back toward discipleship in today’s church especially among those influenced by Rick Warren’s blockbuster book \u0027The Purpose-Driven Life\u0027), but Integrity remains as sort of the \u0027\u0027Microsoft\u0027\u0027 of worship music\", \"priority\":7}]}, \"synonyms\":{}}");

	add("microsome", "{\"term\":\"microsome\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A vesicle formed as an artifact of cell disruption\", \"priority\":1}]}, \"synonyms\":{}}");

