	add("microsporogenesis", "{\"term\":\"microsporogenesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The formation of four haploid microspores by meiosis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In angiosperms, the formation of pollen and thus the production of the male gametophyte\", \"priority\":2}]}, \"synonyms\":{}}");

