	add("microstructure", "{\"term\":\"microstructure\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|structure|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fine structure of a material or tissue as revealed by microscopy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The fine structure of a pure metal or alloy, as revealed by magnifications of 25X or greater\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Fine-scale structure in such variables as temperature, salinity, velocity, etc\", \"priority\":3}]}, \"synonyms\":{}}");

