	add("microtonality", "{\"term\":\"microtonality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|microtonal|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use of microtones in composition\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"he proved that \u0027\u0027microtonality\u0027\u0027 and the angular vocal and instrumental lines that typically evoke modernist angst can just as easily create manic comedy\", \"priority\":2}]}, \"synonyms\":{}}");

	add("microtransaction", "{\"term\":\"microtransaction\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|transaction|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A transaction for a very small amount of money (a micropayment\", \"priority\":1}]}, \"synonyms\":{}}");

	add("microtrend", "{\"term\":\"microtrend\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|trend|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very small, specific trend or vogu\", \"priority\":1}]}, \"synonyms\":{}}");

	add("microtubing", "{\"term\":\"microtubing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|tubing|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Very fine plastic tubing used in drip irrigation, typically in greenhouses\", \"priority\":1}]}, \"synonyms\":{}}");

	add("microtuner", "{\"term\":\"microtuner\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|tuner|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An electronic device or audio software endowed with microtuning capabilities specifically designed and used to modify the tuning of musical instruments, hence allowing for microtonal scales, just intonation scales and tunings other than the twelve-tone equal temperament to be played (\u0027microtonal tuner\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"High-precision mechanical tuning device found on some vintage brass and reed instruments\", \"priority\":2}]}, \"synonyms\":{}}");

	add("microvacation", "{\"term\":\"microvacation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|vacation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very brief vacation; a momentary respite from the cares of everyday life\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, w:Thomas Thomas Pynchon, \u0027Vineland\u0027, Penguin Books (1991), ISBN 9780140145113, page 92\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"With only a few tree silhouettes, and both the freeways and El Camino Real miraculously silent, for just these moments Ralph Sr., appreciative of peace as anybody, could take another of what he\u0027d come to think of as \u0027\u0027microvacations\u0027\u0027 on an island of time fragile and precious as any Tahiti or one of them\", \"priority\":3}]}, \"synonyms\":{}}");

	add("microvacuole", "{\"term\":\"microvacuole\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|vacuole|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very small vacuole (typically, in connective tissue\", \"priority\":1}]}, \"synonyms\":{}}");

	add("microviscosity", "{\"term\":\"microviscosity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|viscosity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The friction experienced by a single particle undergoing diffusion because of its interaction with its environment at the micrometer length scale\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Both the crowding density and relative size of each co-solute in a mixture will contribute to the measured \u0027\u0027microviscosity\u0027\u0027 as assessed by altered translational mobility. \u0026lt;ref\u0026gt; Goins, A.B., H. Sanabria, M. N. Waxham. 2008. Macromolecular crowding and size effects on probe \u0027\u0027microviscosity\u0027\u0027. Biophys. J. 95:5362-5373.\u0026lt;/ref\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The friction experienced by a single particle can be thought of as a microscopic viscosity (\u0027\u0027microviscosity\u0027\u0027) and should not necessarily agree with the bulk viscosity since it is a measure of the probe\u0027s local friction whereas bulk viscosity analogously would be the measure of an infinitely large probe. \u0026quot;Aron Benjamin Goins\u0026quot; \u0026lt;ref\u0026gt; Goins, A.B. 2008 (Thesis) Crowding and size effects on probe \u0027\u0027microviscosity\u0027\u0027 for polymer cytosolic mimicry. http://www.microviscosity.com \u0026lt;/ref\u0026gt\", \"priority\":3}]}, \"synonyms\":{}}");

	add("microwave", "{\"term\":\"microwave\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|wave|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An electromagnetic wave with wavelength between that of infrared light and radio waves\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A microwave oven\", \"priority\":2}]}, \"synonyms\":{\"list\":[{\"text\":\"nuke\", \"synonymQualifier\":\"COLLOQUIAL\"}]}}");

	add("microwork", "{\"term\":\"microwork\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|micro|work|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The series of small tasks which together comprise a large unified project, completed by many people over the internet\", \"priority\":1}]}, \"synonyms\":{}}");

	add("microzyma", "{\"term\":\"microzyma\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|Looks like Ancient Greek|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any pleomorphic organism inside any given body\", \"priority\":1}]}, \"synonyms\":{}}");

